import React from 'react';
import './App.css';
import LeftRectangle from './LeftRect.js';
import RightRectangle from './RightRect.js';

function App() {
  return (
    <div>
        <RightRectangle className="right"/>
        <LeftRectangle className="left"/>
    </div>
  );
}

export default App;
